import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";
import Home from "./Home";
import Menu from "./Menu";
import Footer from "./Footer";

import cloud from './images/cloud.png';
import gal1 from './images/gal1.png';
import gal2 from './images/gal2.png';
import gal3 from './images/gal3.png';
import gal4 from './images/gal4.png';
import gal5 from './images/gal5.png';
import { Facebook, Instagram, Twitter } from '@material-ui/icons';

import './App.css';
import React from "react";
import Gallery from "./Gallery";

function App() {
  return (
    <div className="App parallax col-12">
        <Home />
        <Menu />
        <Gallery />
        <Footer />
        <div className='footer-final flex col-12 col-m-12 col-l-12'>
            <h5>Designed by Vision Web Design</h5>
            <div className='socials footer-socials flex col-m-2 col-l-1'>
                <Facebook className='social icon'/>
                <Twitter className='social icon'/>
                <Instagram className='social icon'/>
            </div>
        </div>
    </div>
  );
}

export default App;
